// Imports
import './App.css';
import Header from './components/Header'; // Import the Header component
import Figure from './components/Figure'; // Import the Figure component
import { useSelector } from 'react-redux'; // Import the useSelector and useDispatch from redux
import { updateWrongLetters } from '../store/hangman'; // Import actions form hangman slice

function App() {

  // Declare the nextId variable from the hangman slice store
  const wrongLetters = useSelector((state) => state.hangman.wrongLetters);

  return (
    <div className="App">
      <Header />
      <Figure wrongLetters={wrongLetters} />
    </div>
  );
}

export default App;
